INSERT INTO `noticias` (`id`, `titulo`, `detalle`, `autor`, `fecha`, `link`) VALUES
(7, 'El mayor accionista de Tencent compra Stack Overflow: 1.800 millones de dólares por una web de referencia para programadores', 'No hay programador que, buscando solucionar alguna duda de código, no haya acabado en Stack Overflow alguna vez en su vida. La web de preguntas y respuestas, así como librerías de código, ahora cambia de dueño. El gigante inversor en tecnología Prosus se ha hecho con la plataforma.  Stack Overflow se ha posicionado durante los últimos años como el lugar de referencia para resolver dudas de programación. Mediante su servicio de preguntas y respuestas la comunidad comparte sus conocimientos sobre diferentes lenguajes de programación. Dicen que tienen más de 100 millones de visitantes al mes.', 'CRISTIAN RUS', '2021-06-03', 'https://www.xataka.com/empresas-y-economia/mayor-accionista-tencent-compra-stack-overflow-1-800-millones-dolares-web-referencia-para-programadores'),
(9, 'Rust es el lenguaje de moda y hay quien cree que se convertirá en el sucesor del legendario C', 'Mozilla es conocida sobre todo por su navegador web, Firefox. Lo que no sabe tanta gente es que son los creadores de Rust, un lenguaje de programación que se está convirtiendo poco a poco en una contribución aún más importante para la industria tecnológica.  El éxito de Rust es espectacular. Un año tras otro las encuestas lo califican como ese lenguaje que todos los programadores aman, y con razón: tiene muchas de las ventajas de los legendarios C y C++, pero sin sus problemas de gestión de memoria. Eso, dicen algunos, podría convertirlo en sucesor de esos legendarios lenguajes.  Un lenguaje que recupera ideas de los 80 y las adapta a los nuevos tiempos Rust dio sus primeros pasos en 2006: fue entonces cuando al ingeniero de Mozilla Graydon Hoare se le ocurrió que la industria necesitaba un nuevo lenguaje de programación.', 'Javier Pastor', '2021-04-30', 'https://www.xataka.com/aplicaciones/rust-lenguaje-moda-hay-quien-cree-que-se-convertira-sucesor-legendario-c'),
(10, 'En 2021 la demanda de desarrolladores y programadores expertos aumentará en un 30%', 'Una de las lecciones que nos ha dejado el 2020 en el mercado laboral es la confirmación de que los expertos en el mundo digital son los profesionales que van a tener una mayor demanda y valor de ahora en adelante. De hecho, los últimos datos de la Encuesta de la Población Activa (EPA) del INE, revelan que el empleo TIC ha crecido a un ritmo del 18,3 % acumulado durante el pasado año, con cambios en función de cada trimestre, pero siempre en positivo.Sin embargo, el sector digital es cada vez más amplio y aglutina especialidades de lo más variadas. Por eso, dentro de este ámbito existen perfiles profesionales que el próximo año serán más populares que otros.Entre ellos, tal y como ya anuncian algunas fuentes del sector, estarán los especialistas en coding y los programadores. Según datos de la consultora Recluit, en 2021 la demanda de desarrolladores web y programadores expertos en los códigos back-end y front-end aumentará en un 30%.Pero, ¿cómo subirse a este carro?, ¿por dónde empezar?, ¿qué tipo de formación y habilidades necesita un profesional para ser un programador competente?.', 'Javier Pastor', '2021-04-06', 'https://www.equiposytalento.com/talentstreet/noticias/2021/02/05/en-2021-la-demanda-de-desarrolladores-y-programadores-expertos-aumentara-en-un-30/4499/'),
(15, 'Si quieres aprender a programar, éstos son los lenguajes más populares y prometedores en 2021', 'Ser desarrollador está de moda, y, según el país y el puesto, también te puede hacer ganar mucho dinero. Diversas encuestas y estudios han ido dejando claro en los últimos años qué lenguajes de programación son los más populares y demandados, y es buen momento para saber cómo está el mercado actual.  Sobre todo porque la pandemia ha desatado un claro auge del uso de todo tipo de servicios online. Las empresas tecnológicas se han convertido en las más valiosas del planeta, y todas ellas se sustentan bajo un mismo pilar fundamental: el código de sus aplicaciones y servicios. Y ese código lo crean y mantienen desarrolladores de todo tipo.  Unos son más amados, otros mejor pagados Para analizar qué lenguajes de programación son más populares y están más demandados en el mercado laboral existen desde hace tiempo una serie de índices que tratan de medir esa relevancia.  Lo hacen a través sobre todo de encuestas (StackOverflow), la agregación de buscadores (TIOBE) o el número de tutoriales que se pueden encontrar en Google sobre cada lenguaje de programación (PyPL), y tras el tema que publicamos en mayo de 2018 quisimos hacer un repaso a una situación que ha variado, pero no de forma especialmente radical.', 'Javier Pastor', '2021-03-01', 'https://www.xataka.com/aplicaciones/quieres-aprender-a-programar-estos-lenguajes-populares-prometedores-2021'),
(16, 'Toolbox, la herramienta made in Málaga que enseña a programar en 300 centros educativos de España', 'Toolbox, la herramienta ideada y diseñada por el catedrático de Inteligencia Artificial de la Universidad de Málaga Francisco Vico para facilitar el acceso a la programación de niños y adolescentes, ya se utiliza en 300 centros educativos de España y ha dado el salto a Colombia. El dispositivo informático se aplica en centros educativos para adquirir competencias digitales y resolver tareas.Toolbox Academy es una empresa de base tecnológica de la Universidad de Málaga y la hemos conocido mas a fondo hoy en el espacio Emprende en Málaga. Ya puedes escuchar la entrevista con Francisco Vico, el creador de esta herramienta', 'Cadena ser', '2021-04-15', 'https://cadenaser.com/emisora/2021/04/15/ser_malaga/1618506239_980503.html');

